import React from 'react';
import axios from 'axios';
const Them = () => {
    const [Ten, setTen] = React.useState('');
    const [Linkimg, setLinkimg] = React.useState('');
    const [Gia, setGia] = React.useState('');
    const isChangeTen = val => setTen(val.target.value);
    const isChangeLink = val => setLinkimg(val.target.value);
    const isChangeGia = val => setGia(val.target.value);

    return (
        <div >
            <div class="container" style={{ marginTop: 50 }}>
                <div class="row">
                    <div class="col-xl-4">
                        <div class="form-group">
                            <input type="text" name="" id="" class="form-control" placeholder="" aria-describedby="helpId" onChange={(val) => isChangeTen(val)} placeholder="Nhập Tên Cây Cảnh" />
                        </div>
                    </div>
                    <div class="col-xl-4">
                        <div class="form-group">
                            <input type="text" name="" id="" class="form-control" placeholder="" aria-describedby="helpId" onChange={(val) => isChangeLink(val)} placeholder="Nhập Link ảnh Cây" />
                        </div>
                    </div>
                    <div class="col-xl-4">
                        <div class="form-group">
                            <input type="text" name="" id="" class="form-control" placeholder="" aria-describedby="helpId" onChange={(val) => isChangeGia(val)} placeholder="Nhập Gía" />
                        </div>
                    </div>
                </div>
            </div>
            <div class="container align-center">
            <button type="button" class="btn btn-primary btn-lg" onClick={() => {
                axios.post('http://localhost:5000/addcay', {
                    Ten,
                    Linkimg,
                    Gia
                })
                    .then(function (response) {
                        alert(response)
                    })
                    .catch(function (error) {
                        alert(Ten+ Linkimg+ Gia, error)
                    });
            }}>Thêm dữ liệu</button>
            </div>
            

        </div>
    );
}
export default Them;
